import React, { useState } from 'react';
import "./../css/Card.css"





function Card(props) {
    function handleClick(event){
        props.onClick(event.target)
    }


    return (
            <img className="card" onClick={handleClick} id={props.index} key={props.index} src={props.src} ></img>
    );
}

export default Card;
